import React, { Component } from 'react';

export class Mission extends Component {
    state = {  }

    styles = {
        header: {
            color: 'red',
            fontSize: 35,
        },
        bold: {
            fontWeight: 'bold'
        },
        blue: {
            color: 'blue'
        }
    }

    render() { 
        return ( 
            <div class="container border-left border-right">
                <div class="row border-right">
                    <div class="col-8">
                        <h1 class="display-4" style={this.styles.header}> ADVANCED GEOPHYSICAL TECHNOLOGY</h1>
                    </div>
                    <div class="col-4">
                        <img src={require("../images/mission-timeline2017.png")} alt="timeline"/>
                    </div>
                </div>
            </div>
        );
    }
}
